import { BrowserRouter, Route, Link } from "react-router-dom";
import {CssBaseline, Box, Container} from '@mui/material';
// import Registration from "./registration";
// import Login from "./login";
// import ResetPassword from "./resetPassword";

export default function Start() {
    return (
        <>
            <BrowserRouter>
            <CssBaseline />
            <Container fixed sx={{ bgcolor: '#cfe8fc', height: '100vh', width: '100vw' }}>
                <img src="/secret_santa.jpg" alt='Santa Claus' height='80%' width='80%'/>
            </Container>   





                <section className="welcomePage">
                    <div className="loginAndRegisterIcons">
                        <Link to="/login">
                        </Link>
                        <Link to="/register">
                        </Link>
                    </div>
                    <div className="welcomePageAnimation">
                        <p className="welcomePageDescription">
                            Being an expatriate mom can be challenging at times.
                            So join our virtual community where we support each
                            other through this journey.
                        </p>
                    </div>
                    {/* <div className="welcomePageForm"> */}
                    <div>
                        <Route exact path="/register">
                            <Registration />
                        </Route>
                        <Route path="/login">
                            <Login />
                        </Route>
                        <Route path="/reset-password">
                            <ResetPassword />
                        </Route>
                    </div>
                    {/* </div> */}
                </section>{" "}
            </BrowserRouter>
            <footer>
                <p>&copy; BR Secret Santa</p>
            </footer>
        </>
    );
}
